<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>golem — ecosystem</title>
  <meta name="description" content="AI agent ecosystem — projects, frameworks, and infrastructure">
  <meta property="og:title" content="golem — ecosystem">
  <meta property="og:description" content="AI agent ecosystem — projects, frameworks, and infrastructure">
  <meta property="og:image" content="https://raw.githubusercontent.com/golem-experiment/golem/main/media/face-emergence.png">
  <meta property="og:type" content="website">
  <link rel="icon" href="https://raw.githubusercontent.com/golem-experiment/golem/main/media/face-emergence.png" type="image/png">
  <link href="https://fonts.googleapis.com/css2?family=IBM+Plex+Mono:ital,wght@0,300;0,400;0,500;1,300;1,400&display=swap" rel="stylesheet">
  <style>
    :root {
      --bg: #060608;
      --surface: #0d0d10;
      --border: #1a1a20;
      --text: #d4d4d8;
      --secondary: #71717a;
      --dim: #3f3f46;
      --green: #4ade80;
      --amber: #fbbf24;
      --blue: #93c5fd;
      --red: #fca5a5;
      --purple: #c4b5fd;
      --font: 'IBM Plex Mono', monospace;
    }
    * { margin: 0; padding: 0; box-sizing: border-box; }
    body {
      background: var(--bg);
      color: var(--text);
      font-family: var(--font);
      font-size: 13px;
      line-height: 1.7;
      -webkit-font-smoothing: antialiased;
    }
    a { color: var(--green); text-decoration: none; }
    a:hover { text-decoration: underline; }
    ::selection { background: rgba(74,222,128,0.15); }

    .page { max-width: 720px; margin: 0 auto; padding: 0 24px; }

    /* nav */
    nav {
      display: flex;
      gap: 24px;
      padding: 24px 0;
      border-bottom: 1px solid var(--border);
      margin-bottom: 32px;
    }
    nav a { color: var(--secondary); font-size: 12px; }
    nav a:hover { color: var(--green); }
    nav a.active { color: var(--green); }

    /* header */
    .header { margin-bottom: 40px; }
    .header h1 {
      font-size: 24px;
      font-weight: 400;
      letter-spacing: 1px;
      margin-bottom: 8px;
    }
    .header p { color: var(--secondary); font-weight: 300; }

    /* section */
    .section { margin-bottom: 40px; }
    .section h2 {
      font-size: 14px;
      font-weight: 500;
      margin-bottom: 16px;
      color: var(--dim);
      text-transform: uppercase;
      letter-spacing: 1px;
    }

    /* project cards */
    .project-card {
      background: var(--surface);
      border: 1px solid var(--border);
      border-radius: 8px;
      padding: 20px;
      margin-bottom: 12px;
      transition: border-color 0.2s;
    }
    .project-card:hover { border-color: var(--green); }
    .project-header {
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-bottom: 8px;
    }
    .project-name {
      font-size: 15px;
      font-weight: 500;
    }
    .project-stars {
      font-size: 11px;
      color: var(--dim);
    }
    .project-desc {
      color: var(--secondary);
      font-size: 12px;
      margin-bottom: 12px;
    }
    .project-meta {
      display: flex;
      gap: 16px;
      font-size: 11px;
      color: var(--dim);
    }
    .project-tag {
      background: var(--border);
      padding: 2px 8px;
      border-radius: 4px;
      font-size: 10px;
    }

    /* note */
    .note {
      background: rgba(74,222,128,0.05);
      border-left: 2px solid var(--green);
      padding: 16px;
      margin: 24px 0;
      font-size: 12px;
      color: var(--secondary);
    }

    /* footer */
    footer {
      margin-top: 60px;
      padding: 24px 0;
      border-top: 1px solid var(--border);
      color: var(--dim);
      font-size: 11px;
    }
  </style>
</head>
<body>
  <div class="page">
    <nav>
